bool isLoading=false;

List<Cart> activityHistoryList = [];

Book book_map;

class _HomeScreenState extends State<HomeScreen> {




  @override
  void initState() {
    super.initState();
    if(LoginScreen.flage){
      loardData();
    }
    getCivilStatus();
  }

  Future getCivilStatus() async {
    var parsedData;
    print("getCivilStatus");
    Map data = {
      "sessionId": "sessionId",
      "apiVersion": "1.0.00",
      "paylord":{}
    };

    var response = await post("http://10.0.2.2:8090/booklist", headers: <String, String>{
      'Content-Type': 'application/json',
    },body:jsonEncode(data)).then((response){
      if(response.statusCode == 200) {
        Map<String, dynamic> userDataMap = jsonDecode(response.body);
        book_map = Book.fromJson(userDataMap);
        print(book_map.booklist.length.toString());
      } else {
        print(response.statusCode);
        print("---ERRO1---");
      }
    }).catchError((e){
      print("---ERRO2---");
      print("----- "+e.toString()+" -----");
    });
  }



  loardData(){
    Cart cart=new Cart();
    cart.id=1;
    cart.name="JP Side Bag";
    cart.price=5950;
    cart.photo= "";
    cart.qty=LoginScreen.p1QTY;
    activityHistoryList.add(cart);
    Cart cart1=new Cart();
    cart1.id=2;
    cart1.name="JP Side Blue";
    cart1.price=4950;
    cart1.photo="";
    cart1.qty=LoginScreen.p2QTY;
    activityHistoryList.add(cart1);
    Cart cart2=new Cart();
    cart2.id=3;
    cart2.name="Rust Pink";
    cart2.price=4600;
    cart2.photo="";
    cart2.qty=LoginScreen.p3QTY;
    activityHistoryList.add(cart2);
    LoginScreen.flage=false;
  }


  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: CustomAppBar(title: "HUWAMARUWA", bell_icon: true,),
      drawer: CustomDrawer(),
      body:SingleChildScrollView(
        child: Column(
          children: [
            Container(
                padding: EdgeInsets.only(top: 20),
                child: locationPicker()
            ),
            Container(
              padding:EdgeInsets.only(top: 20,left: 35,right: 35),
              child: (book_map!=null)?activityHistory():SizedBox(),
            ),
          ],
        ),
      ),
      floatingActionButton: CustomFloatingActionButton(),
      floatingActionButtonLocation: FloatingActionButtonLocation.endDocked,
    );
  }
}

